sys_variable_value.value:
(function execute(inputs, outputs) {
var loader = new GlideImportSetLoader();
var importSetRec = loader.ImportSetGr(inputs,dataSource);
var ranLoad = loader.ImportSetGrloadImportSetTable (ImportSetRec, Inputs.dataSource);
importSetRec.state = "loaded";
importSetRec.stateupdate();

  outputs.importSet = importSetRec.getUniqueValue();

})(inputs, outputs);

